import styled from "@emotion/styled";

export const MainWrapper = styled.div `
    display: table;
    th {
        text-align: center;
    }
    td {
        border-bottom: .05em solid white;
    }
`

export const TableHeader = styled.div`
    box-shadow: 0 0 10px #181818;
`
